	dl ld_dw_8
	dl ld_dw_9
	dl ld_dw_10
	dl ld_dw_11
	dl ld_dw_12
	dl ld_dw_13
	dl ld_dw_14

; Import dws .rgba2 bitmap files and load them into VDP buffers

ld_dw_6:
	ld hl,Fdw_6
	ld (cur_filename),hl
	ld de,filedata
	ld bc,65536
	ld a,mos_load
	RST.LIL 08h
	ld hl,BUF_DW_6
	ld bc,320
	ld de,30
	ld ix,9600
	call vdu_load_img
	ret

